import { Injectable } from "@angular/core";

@Injectable()
export class Tile { 
    explored: boolean;
    preview: boolean;
    walkable: boolean;
    explorable: boolean;
    contents: string;
    xCoord: number;
    yCoord: number;


    constructor(explored: boolean, preview: boolean, walkable: boolean, explorable: boolean, contents?: string, xCoord?: number, yCoord?: number ) {
      this.explored = explored;
      this.preview = preview;
      this.walkable = walkable;
      this.explorable = explorable;
      this.contents = contents;
      this.xCoord = xCoord;
      this.yCoord = yCoord;



      }

}
